    TResult Function(_authorize value)? authorize,
    TResult Function(_unauthorize value)? unauthorize,
    required TResult orElse(),
  }) {
    if (unauthorize != null) {
      return unauthorize(this);
    }
    return orElse();
  }
}

abstract class _unauthorize implements AuthEvent {
  const factory _unauthorize() = _$_unauthorize;
}
